import React, { Component } from 'react';

class Maps extends Component{

    render() {

        var map = document.getElementById('map');
        navigator.geolocation.getCurrentPosition(worksPosition, ErrorPositiion);

        return(
            <div id="map"></div>
        );
    }
}

export default Maps;
